import { Avatar, Button } from '@material-ui/core';
import VideocamIcon from '@material-ui/icons/Videocam';
import PhotoLibraryIcon from '@material-ui/icons/PhotoLibrary';
import React from 'react';
import styled from 'styled-components';

const DivContainer = styled.div`
  display:flex;
  flex-direction:column;
  margin-top:30px;
  background-color:white;
  border-radius:15px;
  box-shadow:0px 5px 7px -7px rgba(0,0,0,0.75);
  width:100%;
`
const TopContainer = styled.div`
  display:flex;
  border-bottom:1px solid #eff2f5;
  padding:15px;
`
const BottomContainer = styled.div``
const Form = styled.form``
const Description = styled.input``
const Prix = styled.input``
const Protable = styled.input``
const Bottom_option = styled.div``
export const MessageSender = () => {
  const handelSubmit = (e) => {
    e.preventDefault();
  }
  return (
    <DivContainer>
      <TopContainer>
        <Avatar />
        <Form>
        <Description/>
        <Prix type='number' placeholder='Prix'/>
        <Protable type='number' placeholder='Numero de telephone'/>
        <Button onClick={handelSubmit} type='submit'>submit button</Button>
        </Form>
        </TopContainer>
      <BottomContainer>
        <Bottom_option>
          <VideocamIcon style={{ color: 'red' }} />
          <h4>Live Video</h4>
        </Bottom_option>
        <Bottom_option>
          <PhotoLibraryIcon style={{ color: 'green' }}/>
          <h3>Photos/Videos</h3>
        </Bottom_option>
        </BottomContainer>
    </DivContainer>
  )
}
